    \                   Job command and arguments\r\r\r\n\r\r\r\noptional arguments:\r\
    \r\r\n  -h, --help                show this help message and exit\r\r\r\n  -t,\
    \ --time-limit=FSD      Time limit in Flux standard duration, e.g. 2d,\r\r\r\n\
    \                            1.5h\r\r\r\n      --priority=N          Set job priority\
    \ (0-31, default=16)\r\r\r\n      --job-name=NAME       Set an optional name for\
    \ job to NAME\r\r\r\n  -o, --setopt=OPT          Set shell option OPT. An optional\
    \ value is\r\r\r\n                            supported with OPT=VAL (default\
    \ VAL=1) (multiple\r\r\r\n                            use OK)\r\r\r\n      --setattr=ATTR=VAL\
    \    Set job attribute ATTR to VAL (multiple use OK)\r\r\r\n      --env=RULE \
