    \                     RULE starts with '-' apply rest of RULE as a\r\r\r\n   \
    \                         remove filter (see --env-remove), if '^' then read\r\
    \r\r\n                            rules from a file (see --env-file). Otherwise,\
    \ set\r\r\r\n                            matching environment variables from the\
    \ current\r\r\r\n                            environment (--env=PATTERN) or set\
    \ a value\r\r\r\n                            explicitly (--env=VAR=VALUE). Rules\
    \ are applied in\r\r\r\n                            the order they are used on\
    \ the command line.\r\r\r\n                            (multiple use OK)\r\r\r\
    \n      --env-remove=PATTERN  Remove environment variables matching PATTERN. If\r\
